import { ADD_FAVORITE, DELETE_FAVORITE } from "./actionsTypes";

export const addFavorite = (id) => {
    return {
        type: ADD_FAVORITE,
        payloead: id
    }
}

export const deleteFavorite = (id) => {
    return {
        type: DELETE_FAVORITE,
        payloead: id
    };
};
